import logo from "./assests/logo.gif";

export default function Footer() {
  return (
    <>
      <footer className="bg-dark text-center text-white foot">
        <div className="img1"><img src={logo} alt=" " /></div>
       
        <ul className="ul">
          <li><a href="#" className="a">Login</a></li>
          <li><a href="#" className="a">Blog</a></li>
          <li><a href="#" className="a">About Us</a></li>
          <li><a href="#" className="a">Contact</a></li>


        </ul>
      
        <div className=" p-2 ">
